import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Users() {
    const [userData, setUserData] = useState([]);
    const [userIDToDelete, setUserIDToDelete] = useState('');
    const [newUser, setNewUser] = useState({
        name: '',
        username: '',
        dob: '',
        phone: '',
        email: '',
    });

    useEffect(() => {
        fetchUsers();
    }, []);

    const fetchUsers = async () => {
        try {
            const response = await axios.get('http://localhost:3001/getUsers');
            setUserData(response.data);
        } catch (error) {
            console.error("Error fetching users", error);
        }
    };

    const deleteUserHandler = async (id) => {
        try {
            await axios.delete('http://localhost:3001/deleteUser', { data: { userID: id } });
            fetchUsers();
        } catch (error) {
            console.error("Error deleting user", error);
        }
    };

    const addUserHandler = async () => {
        try {
            await axios.post('http://localhost:3001/addUser', newUser);
            fetchUsers();
            setNewUser({
                name: '',
                username: '',
                dob: '',
                phone: '',
                email: '',
            });
        } catch (error) {
            console.error("Error adding user", error);
        }
    };

    return (
        <div>
            <h3>Add New User</h3>
            <input 
                type="text" 
                placeholder="Name" 
                value={newUser.name} 
                onChange={(e) => setNewUser({ ...newUser, name: e.target.value })}
            />
            <input 
                type="text" 
                placeholder="Username" 
                value={newUser.username} 
                onChange={(e) => setNewUser({ ...newUser, username: e.target.value })}
            />
            <input 
                type="text" 
                placeholder="DOB" 
                value={newUser.dob} 
                onChange={(e) => setNewUser({ ...newUser, dob: e.target.value })}
            />
            <input 
                type="text" 
                placeholder="Phone" 
                value={newUser.phone} 
                onChange={(e) => setNewUser({ ...newUser, phone: e.target.value })}
            />
            <input 
                type="text" 
                placeholder="Email" 
                value={newUser.email} 
                onChange={(e) => setNewUser({ ...newUser, email: e.target.value })}
            />
            <button onClick={addUserHandler}>Add User</button>

            <h3 style={{ borderBottom: '2px solid #3498db', paddingBottom: '10px', marginTop: '20px' }}>Existing Users</h3>
            <table style={{ width: '100%', borderCollapse: 'collapse' }}>
                <thead>
                    <tr>
                        <th style={{ borderBottom: '2px solid #3498db', paddingBottom: '10px', fontSize: '20px' }}>Name</th>
                        <th style={{ borderBottom: '2px solid #3498db', paddingBottom: '10px', fontSize: '20px' }}>Username</th>
                        <th style={{ borderBottom: '2px solid #3498db', paddingBottom: '10px', fontSize: '20px' }}>Date of Birth</th>
                        <th style={{ borderBottom: '2px solid #3498db', paddingBottom: '10px', fontSize: '20px' }}>Phone</th>
                        <th style={{ borderBottom: '2px solid #3498db', paddingBottom: '10px', fontSize: '20px' }}>Email</th>
                        <th style={{ borderBottom: '2px solid #3498db', paddingBottom: '10px', fontSize: '20px' }}>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {userData.map((user) => (
                        <tr key={user.id}>
                            <td>{user.name}</td>
                            <td>{user.username}</td>
                            <td>{user.dob}</td>
                            <td>{user.phone}</td>
                            <td>{user.email}</td>
                            <td>
                                <button style={{ padding: '10px 15px', borderRadius: '5px', backgroundColor: '#e74c3c', color: 'white', border: 'none', cursor: 'pointer' }} onClick={() => deleteUserHandler(user.id)}>
                                    Delete
                                </button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default Users;
